    false,nt"url": null,nt"notes": "NCEI Accession 0156116 includes physical,
    profile and underway data collected aboard the ROGER REVELLE during cruise RR1606
    in the Philippine Sea from 2016-05-19 to 2016-05-29. These data include CONDUCTIVITY,
    CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
    SALINITY and WATER TEMPERATURE. The instruments used to collect these data include
    ADCP, CTD and GPS. These data were collected by Hemantha Wijesekera of US Navy;
    Naval Research Laboratory - Washington DC, and by University of California - San
    Diego; Scripps Institution of Oceanography as part of Flow Encountering Abrupt Topography.
    The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NCEI as part
    of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP data represent
    the raw and automated processed data set. Post processed quality assessed data are
